import React, { useState } from 'react';
import { Carousel } from 'react-responsive-carousel';
import { motion } from 'framer-motion';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import './Home.css';

const services = [
    {
        title: "Rénovation Intérieure",
        image: "https://via.placeholder.com/150",
        description: "Optimisez l'espace et modernisez votre intérieur."
    },
    {
        title: "Cuisine Sur-Mesure",
        image: "https://via.placeholder.com/150",
        description: "Des cuisines élégantes et fonctionnelles adaptées à vos besoins."
    },
    {
        title: "Revêtement Mural",
        image: "https://via.placeholder.com/150",
        description: "Peinture, papier peint, enduit décoratif et bien plus."
    },
];

const Home = () => {
    const [flipped, setFlipped] = useState(Array(services.length).fill(false));

    const handleFlip = (index) => {
        const newFlipped = [...flipped];
        newFlipped[index] = !newFlipped[index];
        setFlipped(newFlipped);
    };

    return (
        <div className="home">

            {/* MENU FIXE */}
            <header className="menu">
                <div className="menu-left">
                    <div className="logo">RÉNOV+</div>
                    <div className="buttons">
                        <button><a href="#hero">Accueil</a></button>
                        <button><a href="#realisations">Réalisations</a></button>
                        <button><a href="#services">Services</a></button>
                        <button><a href="#contact">Contact</a></button>
                    </div>
                </div>
            </header>

            {/* HERO */}
            <motion.section
                id="hero"
                className="hero-section"
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ duration: 1 }}
            >
                <div className="hero-overlay" />
                <div className="hero-content">
                    <h1>Experts en Rénovation</h1>
                    <p>Des projets élégants, efficaces, à votre image.</p>
                </div>
            </motion.section>

            {/* RÉALISATIONS */}
            <motion.section id="realisations" className="carousel-section">
                <h2>Nos Réalisations</h2>
                <Carousel autoPlay infiniteLoop showThumbs={false} showStatus={false}>
                    <div>
                        <img src="https://via.placeholder.com/800x400" alt="Projet 1" />
                        <p className="legend">Salle de bain contemporaine</p>
                    </div>
                    <div>
                        <img src="https://via.placeholder.com/800x400" alt="Projet 2" />
                        <p className="legend">Cuisine ouverte</p>
                    </div>
                </Carousel>
            </motion.section>

            {/* SERVICES */}
            <motion.section id="services" className="services-section">
                <h2>Nos Services</h2>
                <div className="cards-container">
                    {services.map((service, index) => (
                        <div
                            key={index}
                            className={`card ${flipped[index] ? 'flipped' : ''}`}
                            onClick={() => handleFlip(index)}
                        >
                            <div className="card-inner">
                                <div className="card-front">
                                    <img src={service.image} alt={service.title} />
                                    <h3>{service.title}</h3>
                                </div>
                                <div className="card-back">
                                    <p>{service.description}</p>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </motion.section>

            {/* CONTACT */}
            <motion.section id="contact" className="contact-section">
                <h2>Contactez-nous</h2>
                <p>Email : contact@sanamarenov.fr</p>
                <p>Téléphone : 01 23 45 67 89</p>
            </motion.section>

            {/* FOOTER */}
            <footer className="footer">
                <p>© 2025 RÉNOV+ - Tous droits réservés</p>
            </footer>
        </div>
    );
};

export default Home;
